import "./App.css";

import ToDo from './components/ToDo/ToDo';

function App() {
  const DUMMY_TO_DOS = [
    {
      id: "1",
      title: "Do laundry",
      dueTime: new Date(2022, 10, 3, 16, 0),
      priority: "low",
    },
    {
      id: "2",
      title: "Do homework",
      dueTime: new Date(2022, 10, 5, 12, 0),
      priority: "high",
    },
    {
      id: "3",
      title: "Dinner with Tony",
      dueTime: new Date(2022, 10, 3, 18, 0),
      priority: "medium",
    },
  ];

  return (
    <div className="App">
      <h2>Hello World!</h2>
      <ToDo></ToDo>
    </div>
  );
}

export default App;
